import { createRoot } from "react-dom/client";

import { Footer, mainPage } from "./App";

const footElement = document.getElementById("foot");
const foot = createRoot(footElement);

foot.render(
  <Footer />
);


const mainImageElement = document.getElementById("mainPage");
const mainImage = createRoot(mainImageElement);

mainImage.render(
  <mainPage />
);
